to.decrease(getVal); // Not recommended\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   * When two arguments are provided, `.decrease` asserts that the value of the\n</span>","<span class=\"code-comment\">   * given object `subject`'s `prop` property is lesser after invoking the\n</span>","<span class=\"code-comment\">   * target function compared to beforehand.\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   *     var myObj = {val: 1}\n</span>","<span class=\"code-comment\">   *       , subtractTwo = function () { myObj.val -= 2; };\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   *     expect(subtractTwo).to.decrease(myObj, 'val').by(2); // Recommended\n</span>","<span class=\"code-comment\">   *     expect(subtractTwo).to.decrease(myObj, 'val'); // Not recommended\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   * Add `.not` earlier in the chain to negate `.decrease`. However, it's\n</span>","<span class=\"code-comment\">   * dangerous to do so. The problem is that it creates uncertain expectations\n</span>","<span class=\"code-comment\">   * by asserting that the subject either increases, or that it stays the same.\n</span>","<span class=\"code-comment\">   * It's often best to identify the exact output that's expected, and then\n</span>","<span class=\"code-comment\">   * write an assertion that only accepts that exact output.\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   * When the subject is expected to increase, it's often best to assert that it\n</span>","<span class=\"code-comment\">   * increased by the expected amount.\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   *     var myObj = {val: 1}\n</span>","<span class=\"code-comment\">   *       , addTwo = function () { myObj.val += 2; };\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   *     expect(addTwo).to.increase(myObj, 'val').by(2); // Recommended\n</span>","<span class=\"code-comment\">   *     expect(addTwo).to.not.decrease(myObj, 'val'); // Not recommended\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   * When the subject is expected to stay the same, it's often best to assert\n</span>","<span class=\"code-comment\">   * exactly that.\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   *     var myObj = {val: 1}\n</span>","<span class=\"code-comment\">   *       , noop = function () {};\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   *     expect(noop).to.not.change(myObj, 'val'); // Recommended\n</span>","<span class=\"code-comment\">   *     expect(noop).to.not.decrease(myObj, 'val'); // Not recommended\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   * `.decrease` accepts an optional `msg` argument which is a custom error\n</span>","<span class=\"code-comment\">   * message to show when the assertion fails. The message can also be given as\n</span>","<span class=\"code-comment\">   * the second argument to `expect`. When not providing two arguments, always\n</span>","<span class=\"code-comment\">   * use the second form.\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   *     var myObj = {val: 1}\n</span>","<span class=\"code-comment\">   *       , noop = function () {};\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   *     expect(noop).to.decrease(myObj, 'val', 'nooo why fail??');\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   *     var val = 1\n</span>","<span class=\"code-comment\">   *       , noop = function () {}\n</span>","<span class=\"code-comment\">   *       , getVal = function () { return val; };\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   *     expect(noop, 'nooo why fail??').to.decrease(getVal);\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   * The alias `.decreases` can be used interchangeably with `.decrease`.\n</span>","<span class=\"code-comment\">   *\n</span>","<span class=\"code-comment\">   * @name decrease\n</span>","<span class=\"code-comment\">   * @alias decreases\n</span>","<span class=\"code-comment\">   * @param {String|Function} subject\n</span>","<span class=\"code-comment\">   * @param {String} prop name _optional_\n</span>","<span class=\"code-comment\">   * @param {String} msg _optional_\n</span>","<span class=\"code-comment\">   * @namespace BDD\n</span>","<span class=\"code-comment\">   * @api public\n</span>","<span class=\"code-comment\">   */</span>\n","\n","  <span class=\"code-function\"><span class=\"code-keyword\">function</span> <span class=\"code-title\">assertDecreases</span> (<span class=\"code-params\">subject, prop, msg</span>) </span>{\n","    <span class=\"code-keyword\">if</span> (msg) flag(<span class=\"code-keyword\">this</span>, <span class=\"code-string\">'message'</span>, msg);\n","    <span class=\"code-keyword\">var</span> fn = flag(<span class=\"code-keyword\">this</span>, <span class=\"code-string\">'object'</span>)\n","      , flagMsg = flag(<span class=\"code-keyword\">this</span>, <span class=\"code-string\">'message'</span>)\n","      , ssfi = flag(<span class=\"code-keyword\">this</span>, <span class=\"code-string\">'ssfi'</span>);\n","    <span class=\"code-keyword\">new</span> Assertion(fn, flagMsg, ssfi, <span class=\"code-literal\">true</span>).is.a(<span class=\"code-string\">'function'</span>);\n","\n","    <span class=\"code-keyword\">var</span> initial;\n","    <span class=\"code-keyword\">if</span> (!prop) {\n","      <span class=\"code-keyword\">new</span> Assertion(subject, flagMsg, ssfi, <span class=\"code-literal\